import React from 'react';
import AccountDetails from './AccountDetails';

const PlayButton = () => {
  console.log('lets play!');
}

const ShowPage = () => {
    return (
      <div>
        <AccountDetails/>
        <div>
          <button onClick={PlayButton()}>Play</button>
        </div>
      </div>
    )
  }

export default ShowPage;
